// https://leetcode.com/problems/best-time-to-buy-and-sell-stock/description/

// 7,1,5,3,6,4
class MaxProfit {
    public int maxProfit(int[] prices) {
        int minPrice = 100000;
        int maxProfit = 0;

        for (int price : prices) {
            if (price < minPrice) {
                minPrice = price;
            } else if (price - minPrice > maxProfit) {
                maxProfit = price - minPrice;
            }
        }
        return maxProfit;
    }
}

